import React from 'react'
import {useNavigate} from 'react-router-dom'

function Home() {
  let nav=useNavigate()
  return (
    <div className='homepage'>
     <button onClick={()=>nav("/login")}>LOGIN</button>
     <button onClick={()=>nav("/signup")}>SIGN UP</button>
    </div>
  )
} 

export default Home
